import React from "react";
import "./Bauble.css";

const Bauble = ({ referenceLink = "#", ionicon, withBauble = false }) => {
  state = { toggleHover: false };

  return (
    <div
      className={withBauble && ".baubles-bubble"}
      onMouseEnter={this.toggleHover}
      onMouseLeave={this.toggleHover}
    >
      <a
        href={referenceLink}
        target="_blank"
        rel="noopener noreferrer"
        className="baubles"
      >
        <ion-icon name={ionicon}></ion-icon>
      </a>
    </div>
  );
};

export default Bauble;
